from num2words import num2words
from itertools import count, islice
def f(n): return sum(1 for c in num2words(n, lang='tr') if c.isalpha())
def agen(): # generator of terms
    n, adict = 2, dict()
    for k in count(0):
        v = f(k)
        if v not in adict:
            adict[v] = k
            while n in adict:
                yield adict[n]
                n += 1
